import './index.css'
const App = () => {

    const [name,setname]=useState();

    const inputEvent=(event)=>{
        // console.log(event.target.value);
        setname(event.target.value);
    }

    return (
        <>
        <div>
          <h1>Hello {name}</h1>   
          <input type="text" placeholder="Enter yout name" onChange={inputEvent} 
            value
          />
          <button>Enter</button>
        </div>
        
        </>
    );
}
export default App
